INSERT INTO `comments` VALUES (1,2,'Story','','Claro que sí. Todas las cosas que nos encontramos y nos hacen variar el rumbo a mejor, que nos abren los ojos, están ahí por algo. ¡Sólo hay que mirar bien y fijarse en el camino que nos disponen las estrellas!','',1,NULL,NULL,NULL,1,2,'2009-12-12 15:18:40','2009-12-12 19:33:12',1),(2,2,'Story','','fue el destino, necesitabas volver a creer, y aunque lo que te enviaron fue el libro y no a la chica viste lo que tenias q ver... xD','',13,NULL,NULL,NULL,3,4,'2009-12-14 05:53:03','2009-12-14 05:53:03',13),(3,3,'Story','','Yo opino igual que ese alguien ;) Haz algo ya!!\r\nSaludos','',1,NULL,NULL,NULL,1,2,'2009-12-14 10:16:02','2009-12-14 10:16:04',14),(4,3,'Story','','bueno la verdad amiga creo es casualidad','',0,NULL,NULL,NULL,3,4,'2009-12-15 00:55:20','2009-12-15 00:55:20',16),(5,3,'Story','','yo tnvien haria halgo ya !','',0,NULL,NULL,NULL,5,6,'2009-12-15 02:39:03','2009-12-15 02:39:03',17),(6,4,'Story','',' ni yo mismo se jjaja\r\n','',0,NULL,NULL,NULL,1,2,'2009-12-16 17:12:53','2009-12-16 17:12:53',20),(7,5,'Story','','bueno no creo que abria pasado algo asi pero es alogo inimaginable que te diga.quieres salir conmigo?osea que el penso que eras la parsona perfecta o algo asi.\r\nno soy buena comentando','',0,NULL,NULL,NULL,1,2,'2009-12-17 18:51:46','2009-12-17 18:51:46',24),(8,7,'Story','','quiero que mi matrimonio  vuelva a enpesar pero yo estoy en la carcel y quiero que eya me perdone  y quiero regresar con mi mujer  y quiero enpesar una nueva vida  quiero que me ayudes por favor  te lo pido yo me llamo pedro luis  troyas y mi mujer se llama lusy patron gongora','',0,NULL,NULL,NULL,1,4,'2009-12-18 12:21:49','2009-12-18 12:21:49',27),(9,7,'Story','','quiero que me ayuden  por favor  recuperar mi familia  me llamo luis troyas antepara y mi señora se llama lusi patron gongoray quiero la repuesta porfavor','',0,NULL,NULL,8,2,3,'2009-12-18 14:48:32','2009-12-18 14:48:32',28),(10,7,'Story','','holas como erstas quisiera c