INSERT INTO `stories` VALUES (1,'La que sería mi abuela materna era entonces una niña de 13 años y trabaja de costurera para una señora más mayor, que sería, años después, la madre de mi padre. Tuvieron una muy buena relación durante mucho tiempo, inluso después de dejar de trabajar para ella.\r\n\r\nLa última vez que se vieron, la madre de mi madre visitó a la otra para conocer al hijo que acababa de tener. MI abuela iba embarazada de mi madre. Y mi abuela le dijo: Raquel, a ver si tienes una niña para mi niño. Una broma que se puede hacer.\r\n\r\nMi abuela por parte de padre, murió a los dos años y mis padres nunca se vieron de niños pero mi madre siempre escuchó historias de esa familia.\r\n\r\nAl cabo de los años, mi madre entró en una discoteca con dos amigas y vió a un chico en la barra, le gustó y, quizá también como una broma cualquiera dijo: \"Ése es el hombre con el qe¡ue me voy a casar.\" Sus amigas se rieron con la tontería pero 10 meses después estaban casados.\r\n\r\nImaginaos el susto de mi abuela Raquel cuando se enteró de quién era hijo el que iba a ser marido de su hija.\r\n\r\nSí, pueden ser casualidades, cosas que se dicen sin pensar, tal vez muchas veces, pero acertaron. ¿Sólo una casualidad? A mí me gusta pensar que no. :)))))','Así se conocieron mis padres','Así se conocieron mis padres','',0,0,0,0,3,1,1,NULL,NULL,'2009-12-12 14:36:54','2009-12-12 14:40:44',1),(2,'Fue en alemania, en colonia.\r\nEn una noche estuvimos mi amigo y yo al lado del Rhin, tocando la guitarra, cantando, tomando cervecitas al borde del rio.\r\n\r\nSucedió que mis amigos fueron a comprar más cerveza y yo me quedé solo tocando la guitarra. Empecé con los primeras acordes de  \"The end\"(El fin), de Jim Morrisson y The Doors.\r\n\r\nCuando empezaba a cantar una chica pasó por el camino, se paró y me miró fijamente a los ojos mientas escuchaba la cancion. Yo tambián la miré y me puse algo nervioso. Directamente sentía que con ella algo iba a pasar. La verdad es que fueron 3 minutos super mágicos. Cuando terminé la cancion, ella se acercó y dijo \"Hola\". No habia duda de que me hablaba a mí, tenia que ser asi, no habáa otra persona. Nos miramos un rato más y empezamos una conversación de muy pocas palabras, pues todo estaba claro. Ella y yo pensábamos lo mismo: \"Nos tenemos que conocer, tenemos que estar juntos.\"\r\n\r\nElla: Me tengo que ir a tomar el bus.\r\nYo: Voy contigo y te acompaño a la estación.\r\nElla: Claro que vienes conmigo.\r\n\r\nEn la estacion me dió su número y me dijo que la llamara al dá siguiente. Cuando se subió al bus me dijo: \"Has leído El Alquimista, el libro de Paulo Coehlo?\". Yo  respondí con un \"No\".\r\n\r\nMe enamoré intensamente y a la mañana siguiente no fui a la uni, sino a la librería a comprar \"El Alquimista\". Sin pausas lo leí en un dia.\r\n\r\nPara que los que no conocen al libro, trata de un joven que esta buscando su camino, y mientras aprende que cada persona tiene un camino predeterminado y que sólo hay que estar atento para ver los signos que lo guían.\r\n\r\nMe encantó. Y pensé: \"Esa chica se cruzó en mi camino sólo para hablarme del libro, para que yo empiece a sensibilizarme\"\r\n\r\nY asi fue! Muy enamorado la llamé y le dije \"Ya me he terminado el libro, es increíble, muy bueno. Era un signo que me hablaras de él\".\r\n\r\nQuedamos el día después en mi casa, tomamos mucho vino y empezamos a besarnos y nos acostamos. Pero, os lo podéis creer? Se fue toda la magia, no nos llevabamos bien, una catástrofe. Ella no me gustababa nada y yo a ella tampoco. Se fue de mi casa y nunca más quedé con ella ni la volví a ver.\r\n\r\nLo que se quedó era lo que aprendí en el libro: Creer en los signos, sensibilizarse para ver lo que \"el destino\" te pone en tu camino. Si eres capaz de ver los signos en tu camino, que se manifiestan en personas, en cosas, en tus sueños... el destino te muestra lo que tienes que hacer y va a ser bueno para ti.\r\n\r\nAl final esto es lo que creo: Esta chica me la crucé para que me hablara del libro, para creer en mi destino. Muchas cosas cambiaron a partir de entonces con mis nuevos ojos.\r\n\r\n¿Que creen ustedes?\r\n¿Era destino o sólo casualidad?\r\n','Lo que me hizo creer en los signos y el camino predeterminado de una persona','Lo que me hizo creer en los signos y el camino predeterminado de una persona','fabian.dittrich@gmail.com',0,0,1,0,1,2,3,NULL,NULL,'2009-12-12 15:04:40','2009-12-12 20:37:17',0),(3,'En segundo de secundaria yo iba con un chik que me gustaba demasiado y yo a él, el chiste es que nos peleamos y no nos volvimos a hablar, en tercero yo ya habia olvidado al chiko, entro al salón y zaz ahi estaba él, no nos hablamos nunka, en la prepa lo vi como 3 veces en el camión o en la calle, y ahora en la fac que segun yo ya habia olvidado todo su hermana va con migo no en el mismo salón pero sin en la misma fac la he visto varias veces, pero tambien a él un montón de veces ha pasado por mi fac (no va en la misma pero se que esta cerca y esto ya me tiene harta x que ninguno se anima a hblarse otra vez, pienso que son demasiadas coincidencias una vez alguien me dijo que eso ya era para que hiciera algo, pero ps no se tal vez solo sea casualidad ','extraños encuentros¡','extraños encuentros¡','iveth_0192@hotmail.com',0,0,1,0,1,NULL,10,NULL,NULL,'2009-12-13 20:20:02','2009-12-13 20:20:02',1),(4,'Bueno, esto empieza en la secundaria, en el salón me siento unos 2 bancos atrás d él, a veces se voltea para hablar con la chica de atrás y digamos que me mira de re ojo y lo noto, otras veces en el descanso salgo del salón y nos miramos y me le quedo sonriendo porque, quien no al ver los ojos de aquella persona no se siente feliz que no evita sonreir? , bueno, tmbién, fue mala suerte tocar en el mismo salón, cuando estaba en primero no tocamos juntos, pero cada vez que hiba a su salón me miraba se paraba e hiba a la puerta a \"buscar\" a alguien o Pedirle a un profesor ir a baño, jaja, orita en segundo pues... no sé, el tiene novia pero cuando está con ella me mira de re ojo y lo noto y me volteo rápido.\r\nA  veces ando riendo con mis amigas de estupiddeces, ustedes saben, y el voltea y sonrié a si mismo y lo noto. Waa lo amo, a veces platica de mi con sus amigos, almenos es lo que alcanzo a escuhar porque dice mi nombre, etc.\r\nSolo sé que tocaré con él hasta prepa, ya que su hermano estuvo con mi hermana...\r\nNo lo dejaré de ver en un largo tiempo (=\r\n\r\nY esta es mi historia;\r\nCreen que el LARGO tiempo es coincidencia o el destino?','Él y yo, coincidencia? o destino?','Él y yo, coincidencia? o destino?','',0,0,1,0,3,18,18,NULL,NULL,'2009-12-15 05:01:40','2009-12-18 14:48:54',1),(5,'Estaba yo tranquila en el bus  escuchando musica etc... Cuando vi a un chico guapisimo delante de mi (nononono eso no es lo raro) lo mas raro es que el tio sin conocerme ni nada  me persiguio.Yo al principio pense que solo era casualidad(yo estaba llendo  a un polideportivo a hacer deporte)  y el me seguia persiquiendo pero como dije antes el no me conocia y cuando llege al pòlideportivo el me pregunto \r\nEL:quieres salir conmigo es que  como vi que me mirabas .\r\nYO:lo siento  tengo novio (yo no tenia novio sino que me gustaba otro)\r\n  \r\nBueno passaron dias,meses ,años y ahora tengo 33 años (en esa epoca tenia 18 años ) y desde alli el no para de persegruirme y yo veo sienpre por la noche su cara en m almuada','lo mas raro  que me ha pasado','lo mas raro  que me ha pasado','minni_85@hotmail.es',0,0,1,0,3,NULL,21,NULL,NULL,'2009-12-16 20:41:29','2009-12-16 20:41:29',1),(6,'Hola mira yo estoy haciendo artes marciales en un gimnasio y cuando empece a ir los sabados por la mañana conocí a un chico.\r\nel chico no dejaba de mirarme empecemos a juguetear dias después.\r\nestube como dos o tres meses sin verlo, y el dia de la cena se acercó a mi me dijo que estaba loco por verme y no sabia donde encontrarme,, y bueno estubimos juntos toda la noche i nos vemos todos los dias lo que pasa que el tiene noviaa pero no deja de pensar en mi.\r\npero en las casualidades no es que crea mucho ademas si sigue con esto adelante es porque tiene algo en mente...','el chico y yo estamos enamorados pero tiene novia destino o casualidad?','el chico y yo estamos enamorados pero tiene novia destino o casualidad?',NULL,0,0,0,0,3,15,23,NULL,NULL,'2009-12-17 10:00:46','2009-12-17 10:00:46',1),(7,'bueno pues me enamore de una chava ke es mayor ke yo tiene 25 años y yo 17 da la casualidad ke a ella la conosi primero de vista y me enamore de ella a primera vista bueno la desie con toda mi alma por ke si me enamore de verdad paso el tiempo y la conosi me dijo ke yo le gustaba pero al tiempo despues me dijo ke ya no pero aunke nos distanciemos siempre nos andamos encontrando','me enamore pero ella no','me enamore pero ella no',NULL,0,0,0,0,3,17,26,NULL,NULL,'2009-12-18 03:30:48','2009-12-18 03:30:48',1),(8,'Bueno todo empezó hace 9 meses, yo llevaba ya 2 meses en un instituto d idiomas y de repente ella llegó a mi clase, ese mes no nos hablamos nunca, al sgte mes nos tocó en diferentes salones, y ahi conoció a su mejor amiga, luego los siguientes 7 meses ha estado en mi aula, y bueno, al prinicipio me costó hablarle, pero al cuarto mes consegui su msn y nos hablabamos un poco x ahi, aunq en el aula casi nunca, al sgte mes una d sus amigas nos invitó al cine a mi y a mi amigo y empezó a crecer nuestra amistad, y he tenido la suerte q estos ultimos 7 meses consecutivos soy el unico que ha stado en su misma clase y cada mes era aun mejor, ia q todos c iban qitando y al final solo qdamos nosotros dos d los q iniciaron, y este ultimo mes nos hemos pasado todo el tiempo juntos, nunca penc q iegariamos a ser tan amigos, y aunq io siempre qise ser más q eso, c q algun dia lo lograré, pero no x ahora ia q tiene enamorado :( d todas formas este mes c va del instituto y no c si la volveré a ver pronto, pero ia veré si el destino m permite segir conociendola.','No es un adiós, sino un hasta luego...','No es un adiós, sino un hasta luego...',NULL,0,0,0,0,3,19,33,NULL,NULL,'2009-12-18 18:32:02','2009-12-18 18:32:02',1);
